import 'package:json_annotation/json_annotation.dart';part 'applied_data_dto.g.dart';@JsonSerializable(ignoreUnannotated: false)class AppliedDataDto {  @JsonKey(name: 'id')  final int? id;  @JsonKey(name: 'employeeName')  final String? employeeName;  @JsonKey(name: 'freelanceIcon')  final String? freelanceIcon;  @JsonKey(name: 'qualification')  final String? qualification;  @JsonKey(name: 'cityName')  final String? cityName;  @JsonKey(name: 'idNumber')  final String? idNumber;  @JsonKey(name: 'phoneNumber')  final String? phoneNumber;  @JsonKey(name: 'statusName')  final String? statusName;  @JsonKey(name: 'status')  final int? status;  @JsonKey(name: 'deservedAmount')  final double? deservedAmount;  @JsonKey(name: 'listAllowEditOpp')  final List<ListAllowEditOppDto>? listAllowEditOpp;  AppliedDataDto(      {this.id,      this.employeeName,      this.freelanceIcon,      this.qualification,      this.cityName,      this.idNumber,      this.phoneNumber,      this.statusName,      this.status,      this.deservedAmount,      this.listAllowEditOpp});  factory AppliedDataDto.fromJson(Map<String, dynamic> json) => _$AppliedDataDtoFromJson(json);  Map<String, dynamic> toJson() => _$AppliedDataDtoToJson(this);}@JsonSerializable(ignoreUnannotated: false)class ListAllowEditOppDto {  @JsonKey(name: 'statusCode')  final int? statusCode;  @JsonKey(name: 'description')  final String? description;  ListAllowEditOppDto({this.statusCode, this.description});  factory ListAllowEditOppDto.fromJson(Map<String, dynamic> json) => _$ListAllowEditOppDtoFromJson(json);  Map<String, dynamic> toJson() => _$ListAllowEditOppDtoToJson(this);}